import React, { Component, useState } from "react";
import Axios from "axios";
import moment from "moment";

function ShortUrl(props) {
  //const { code } = props;

  const baseurl = "http://localhost";
  const port = ":3001";

  Axios.get(baseurl + port + "/" + props.match.params.code)
    .then((response) => {
      if (response) {
        console.log(response.data[0].fullurl);
      } else {
        this.props.history.push("/404");
      }
    })
    .catch((error) => {
      console.log(error);
      this.props.history.push("/nopage/404");
    });

  return (
    <div className="cotainer">
      <div className="h1">Hello Shortcut</div>
    </div>
  );
}

export default ShortUrl;
